import { Card } from 'antd';

export const CardComponent = ({theme, content }) => {
  return (
    <Card style={{
      border: `1px solid ${theme.borderColor}`,
      borderRadius: '8px',
      padding: '16px',
      background: theme.background,
      color: theme.color,
    }}>
      {content}
    </Card>
  );
};
